import React from 'react';
import { useForm } from 'react-hook-form';
import {
  FieldContainer,
  FieldInput,
  FieldLabel,
  Fieldset,
  FieldTextArea,
  FormButtonContainer,
  PrimaryButton,
} from '../CSS/Styles';
import { Page } from './Page';

type FormData = {
  title: string;
  content: string;
};

export const AskPage = () => {
  const { register } = useForm<FormData>();

  return (
    <Page title="Ask a question">
      <form>
        <Fieldset>
          <FieldContainer>
            <FieldLabel htmlFor="title">Title</FieldLabel>
            <FieldInput
              {...register('title')}
              id="title"
              name="title"
              type="text"
            ></FieldInput>
          </FieldContainer>
          <Fieldset>
            <FieldContainer>...</FieldContainer>
            <FieldContainer>
              <FieldLabel htmlFor="content">Content</FieldLabel>
              <FieldTextArea
                {...register('content')}
                id="content"
                name="content"
              />
            </FieldContainer>
            <FormButtonContainer>
              <PrimaryButton type="submit">Submit Your Question</PrimaryButton>
            </FormButtonContainer>
          </Fieldset>
        </Fieldset>
      </form>
    </Page>
  );
};

export default AskPage;
